import tkinter as tk
from tkinter import ttk
from tkinter import *
from PIL import Image, ImageTk
from random import randint

window = Tk()
window.title("Game Rock Paper and Scissors")
window.configure(bg = "black")
window.geometry("920x600")


def updateMessage(a):
    final_message["text"] = a


def computer_update():
    final = int(computer_score['text'])
    final +=1
    computer_score["text"] = str(final)
    
def player_update():
    final = int(player_score['text'])
    final +=1
    player_score["text"] = str(final)

    
def winner_check(p, c):
    if p == c:
        updateMessage("It's a tie")
    elif p == "rock":
        if c == "paper":
            updateMessage("Computer\nWins!!")
            computer_update()
        else:
            updateMessage("Player\nWins!!")
            player_update()
    elif p == "paper":
        if c == "scissors":
            updateMessage("Computer\nWins!!")
            computer_update()
        else:
            updateMessage("Player\nWins!!")
            player_update()
    elif p == "scissors":
        if c == "rock":
            updateMessage("Computer\nWins!!")
            computer_update()
        else:
            updateMessage("Player\nWins!!")
            player_update()
    else:
         pass


    
to_select = ["rock", "paper", "scissors"]
def choice_update(a):
    choice_computer = to_select[randint(0,2)]
    if choice_computer == "rock":
        label_computer.configure(image = rock_art)
    elif choice_computer == "paper":
        label_computer.configure(image = paper_art)
    else:
         label_computer.configure(image = scissors_art)

    if a == "rock":
        label_player.configure(image = rock_human)
    elif a == "paper":
        label_player.configure(image = paper_human)
    else:
        label_player.configure(image = scissors_human)

    winner_check(a, choice_computer)



def reset_game():
   
    final = int(computer_score['text'])
    final -= final
    computer_score["text"] = str(final)

    final = int(player_score['text'])
    final -= final
    player_score["text"] = str(final)
    
class Icons:    

    rock_art_image = r""
    paper_art_image = r""
    scissors_art_image = r""
    rock_human_image = r""
    paper_human_image = r""
    scissors_human_image = r""    

rock_art = tk.PhotoImage(data = Icons.rock_art_image)
paper_art = tk.PhotoImage(data = Icons.paper_art_image)
scissors_art = tk.PhotoImage(data= Icons.scissors_art_image)
rock_human = tk.PhotoImage(data= Icons.rock_human_image)
paper_human = tk.PhotoImage(data= Icons.paper_human_image)
scissors_human = tk.PhotoImage(data= Icons.scissors_human_image)


#Win or loose

final_message = Label(window, width =29, height=2, font = ("arial", 40, "bold"), justify = CENTER, bg = "black", fg = "white")
final_message.place(x=0 , y= 200)

#labels
label_computer = Label(window, image = rock_art, bg = "black")
label_computer.place(x = 10, y = 200)


label_player = Label(window, image = rock_human, bg = "black")
label_player.place(x = 700, y = 200)


#Welcome
welcome_label = Label(window, width =38, height=2, text = "WELCOME TO THE ROCK PAPER\nSCISSORS GAME", font= ( "arial", 30, "bold"), bg = "black", fg = "yellow")
welcome_label.place(x = 0, y = 10)


#Indicators
computer_indicator = Label(window, font = ("arial", 30, "bold"),
                         text = "COMPUTER", bg= "black", fg = "orange")
computer_indicator.place(x = 97, y= 130)

player_indicator = Label(window, font = ("arial", 30, "bold"),
                         text = "PLAYER", bg= "black", fg = "orange")
player_indicator.place(x = 596, y= 130)


#button    
button_rock = Button(window, width =10, height=2, text = "ROCK",
                     font=("arial", 20, "bold"), bg = "yellow", fg= "red", command = lambda:choice_update("rock"))
button_rock.place(x = 100, y= 400)


button_paper = Button(window, width =10, height=2, text = "PAPER",
                     font=("arial", 20, "bold"), bg = "yellow", fg= "red", command = lambda:choice_update("paper"))
button_paper.place(x = 380, y= 400)


button_scissors = Button(window, width =10, height=2, text = "SCISSORS",
                     font=("arial", 20, "bold"), bg = "yellow", fg= "red", command = lambda:choice_update("scissors"))
button_scissors.place(x = 650, y= 400)

#score
computer_score = Label(window, text = 0, font= ("ivy", 50, "bold"), bg = "black", fg = "red" )
computer_score.place(x = 250, y= 200)

player_score = Label(window, text = 0, font= ("ivy", 50, "bold"), bg = "black", fg = "red")
player_score.place(x = 600, y= 200)

 
#Rest
rest = Button(window, text="Reset Game", font=("arial", 20, "bold"), fg="yellow",
       bg="green", width =10, height=1, command=reset_game)
rest.place(x=380 , y= 530)

window.mainloop()
